import React from 'react';
import logo from "../assets/Logo.png";
import styles from "./Sidebar.module.css";

export default function Sidebar() {
  return (
    <div>
        <div>
            <img className={styles} src={logo} alt='chaabi'/>
        </div>
    </div>
  )
}
